import DUMMY_MEALS from "./dummy-meals"
import MealItem from "./MealItem"

function AvailableMeals(){
    const temp = DUMMY_MEALS

    return(
        <section className="meals">
            <ul>
                {
                    temp.map(meal=>(
                        
                            <MealItem
                                id={meal.id}
                                
                                name={meal.name}
                                description={meal.description}
                                price={meal.price}
                            />

                    ))
                }
            </ul>
        </section>
    )
}

export default AvailableMeals
